const METADATA = {
    website: "https://github.com/WaffleDevsAlt/Shapez.io-Mods",
    author: "WaffleDevs",
    name: "Item Producer",
    version: "1.0.0",
    id: "item_producer",
    description: "Adds the Item Producer into the main game.",
    minimumGameVersion: ">=1.5.0",
};

class MetaItemProducer extends shapez.ModMetaBuilding {
    constructor() {
        super("itemProducer");
    }

    static getAllVariantCombinations() {
        return [
            {
                variant: shapez.defaultBuildingVariant,
                name: "Item Producer",
                description: "Produces items",

                regularImageBase64: RESOURCES["itemProducer.png"],
                blueprintImageBase64: RESOURCES["itemProducerBlueprint.png"],
                tutorialImageBase64: RESOURCES["itemProducerBlueprint.png"],
            },
        ];
    }

    getSilhouetteColor() {
        return "#b37dcd";
    }

    getShowWiresLayerPreview() {
        return true;
    }

    setupEntityComponents(entity) {
       entity.addComponent(
            new shapez.ItemEjectorComponent({
                slots: [{ pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top }],
            })
        );
        entity.addComponent(
            new shapez.WiredPinsComponent({
                slots: [
                    {
                        pos: new shapez.Vector(0, 0),
                        type: shapez.enumPinSlotType.logicalAcceptor,
                        direction: shapez.enumDirection.bottom,
                    },
                ],
            })
        );
        entity.addComponent(new shapez.ItemProducerComponent({}));
    }
}

class Mod extends shapez.Mod {
    init() {
        // Register the new building
        this.modInterface.registerNewBuilding({
            metaClass: MetaItemProducer,
            buildingIconBase64: RESOURCES["itemProducerIcon.png"],
        });

        // Add it to the regular toolbar
        this.modInterface.addNewBuildingToToolbar({
            toolbar: "regular",
            location: "primary",
            metaClass: MetaItemProducer,
        });
    }
}

////////////////////////////////////////////////////////////////////////

const RESOURCES = {
    "itemProducer.png":
        "data:image/png;base64,",
     "itemProducerIcon.png":
        "data:image/png;base64,",
    "itemProducerBlueprint.png":
        "data:image/png;base64,",
};
